package com.vitamincode.vitamincode_be.service.impl;import com.vitamincode.vitamincode_be.entity.Students;import com.vitamincode.vitamincode_be.mapper.StudentsMapper;import com.vitamincode.vitamincode_be.service.StudentsService;import lombok.RequiredArgsConstructor;import org.springframework.stereotype.Service;import java.util.List;@Service@RequiredArgsConstructorpublic class StudentsServiceImpl implements StudentsService {    private final StudentsMapper studentsMapper;    @Override    public List<Students> findAllStudents() {        return studentsMapper.findAllStudents();    }    @Override    public Students findStudentById(Integer studentId) {        return studentsMapper.findStudentById(studentId);    }    @Override    public int insertStudent(Students students) {        return studentsMapper.insertStudent(students);    }    @Override    public int updateStudent(Students students) {        return studentsMapper.updateStudent(students);    }    @Override    public int deleteStudent(Integer studentId) {        return studentsMapper.deleteStudent(studentId);    }}